import React from 'react';
import './styles/App.css';
import Home from './components/Home';
import Header from './components/Header';
import Footer from './components/Footer';

function App() {
return (
<div className="App">
	<main>
		<Header />
		<Home />
		<Footer />
	</main>
</div>
  )}

export default App;
